import React from 'react';
import {Toast} from 'react-bootstrap'

const Header = () => {
  return(
    <Toast>
      <Toast.Header>
        <strong>Tactile Tots</strong>
      </Toast.Header>
      <Toast.Body>hi</Toast.Body>
    </Toast>
  )
}

export default Header
